import React from "react";
// import "./App.scss";
import Input from "../Input/Input";
import Button from "../Button/Button";
import Results from "../Results/Results";

function App() {
    return (
        <main>
            <section className="app">
                <form className="app__form">
                    <div className="app__wrapper">
                        <Input label="Email" />
                        <Input label="Number" />
                    </div>
                    <Button label="Submit" />
                </form>
            </section>

            <Results></Results>
        </main>
    );
}

export default App;
